    const navigate = useNavigate();
    const HandleLogout=()=>{ 
        alert('Logginng out')
        navigate('/login')
    }

    return (
        <header className="header">
        <nav className="nav-links">
          <a href="#">Home</a>
          <a href="#">About Us</a>
          <a href="#">Refresh</a>
          <a href="#">Performance</a>
          <a href="#">Report Bug</a>
        </nav>

